const benfordCoefs: number[] = [
    0.301,
    0.176,
    0.125,
    0.097,
    0.079,
    0.067,
    0.058,
    0.051,
    0.046,
];

const counts: number[] = Array(9).fill(0);

const firstDigit = (transaction: string) => +transaction.match(/[1-9]/).toString();

const N: number = parseInt(readline());
for (let i = 0; i < N; ++i) {
    const transation: string = readline();
    ++counts[firstDigit(transation) - 1];
}

const tolerance = 0.1;
const expectedIntervals = benfordCoefs.map(n => ({
    min: n - tolerance,
    max: n + tolerance,
}));

const unexpectedDigit = counts.some((count, index) => {
    const actualCoef = count / N;

    return actualCoef < expectedIntervals[index].min
        || actualCoef > expectedIntervals[index].max;
});

console.log(unexpectedDigit);
